import{_ as r,c as a,o as t,ae as o}from"./chunks/framework.CinA6sqf.js";const f=JSON.parse('{"title":"About QMK","description":"","frontmatter":{},"headers":[],"relativePath":"about.md","filePath":"about.md"}'),n={name:"about.md"};function i(l,e,h,s,b,d){return t(),a("div",null,[...e[0]||(e[0]=[o('<h1 id="about-qmk" tabindex="-1">About QMK <a class="header-anchor" href="#about-qmk" aria-label="Permalink to &quot;About QMK&quot;">​</a></h1><p>The goal of the QMK software project is to develop a completely customizable, powerful, and enjoyable firmware experience for any project - keyboard or otherwise - and to provide helpful, encouraging, and kind support and feedback for people with any software development experience.</p><p>This is a keyboard firmware based on the <a href="http://github.com/tmk/tmk_keyboard" target="_blank" rel="noreferrer">tmk_keyboard firmware</a> with some useful features for Atmel AVR and ARM controllers, and more specifically, the <a href="http://olkb.com" target="_blank" rel="noreferrer">OLKB product line</a>, the <a href="http://www.ergodox-ez.com" target="_blank" rel="noreferrer">ErgoDox EZ</a> keyboard, and the <a href="http://clueboard.co/" target="_blank" rel="noreferrer">Clueboard product line</a>.</p><h2 id="maintainers" tabindex="-1">Maintainers <a class="header-anchor" href="#maintainers" aria-label="Permalink to &quot;Maintainers&quot;">​</a></h2><p>QMK is developed and maintained by Jack Humbert of OLKB with contributions from the community, and of course, <a href="https://github.com/tmk" target="_blank" rel="noreferrer">Hasu</a>. The OLKB product firmwares are maintained by <a href="https://github.com/jackhumbert" target="_blank" rel="noreferrer">Jack Humbert</a>, the Ergodox EZ by <a href="https://github.com/zsa" target="_blank" rel="noreferrer">ZSA Technology Labs</a>, the Clueboard by <a href="https://github.com/skullydazed" target="_blank" rel="noreferrer">Zach White</a>, and the Atreus by <a href="https://github.com/technomancy" target="_blank" rel="noreferrer">Phil Hagelberg</a>.</p>',5)])])}const u=r(n,[["render",i]]);export{f as __pageData,u as default};
